import React from 'react';
import hoverDescription from '../../hoc/hoverDescription';
import ButtonLink from './Button/ButtonLink';
import NavigationLinkAbout from '../../UserInterface/Navigation/NavigationLinkAbout';

function ButtonNavigation(props) {

    return (
        <>
            {
                props.isOpenDescription ?
                    < NavigationLinkAbout
                        aboutLink={props.linkAbout}
                        classname="NavigationLinkAbout"
                    />
                    :null
            }
            <ButtonLink
                to={props.to}
                name={props.name}
                classname={props.classname}
                onclick={props.onclick}
            />

        </>
    )
}

export default hoverDescription(ButtonNavigation, isOpenDescription)
